import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [matches, setMatches] = useState([]);
  const [loading, setLoading] = useState(true);
  const [selectedMatch, setSelectedMatch] = useState(null); // Estado para el partido seleccionado

  // Funci칩n para obtener los partidos desde el backend Flask
  const fetchFootballMatches = async () => {
    try {
      const response = await axios.get('http://localhost:5000/api/football-matches');
      setMatches(response.data.response);  // Guardar los partidos en el estado
      setLoading(false);  // Cambiar el estado a "no cargando"
    } catch (error) {
      console.error('Error al obtener los partidos:', error);
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchFootballMatches();
  }, []);

  // Funci칩n para manejar el clic en un partido
  const handleMatchClick = (match) => {
    if (selectedMatch && selectedMatch.id === match.id) {
      setSelectedMatch(null); // Si el partido ya est치 seleccionado, lo deseleccionamos
    } else {
      setSelectedMatch(match); // Seleccionamos el partido y mostramos los eventos
    }
  };

  return (
    <div className="App">
      <h1>Partidos de F칰tbol</h1>

      {loading ? (
        <p>Cargando...</p>
      ) : (
        <div className="matches-list">
          {matches && matches.length > 0 ? (
            <ul>
              {matches.map((match, index) => (
                <li key={index} className="match-item" onClick={() => handleMatchClick(match)}>
                  <div className="match-details">
                    <h3>{match.league.name} - {new Date(match.fixture.date).toLocaleString()}</h3>
                    <p>Estadio: {match.fixture.venue.name}, {match.fixture.venue.city}</p>
                    <p><strong>{match.fixture.status.long}</strong> ({match.fixture.status.short})</p>
                    <p>
                      {match.fixture.status.long === "Match Finished" ? (
                        <span>Resultado: {match.goals.home} - {match.goals.away}</span>
                      ) : (
                        <span>En progreso...</span>
                      )}
                    </p>
                    <div className="teams">
                      <div className="home-team">
                        <img 
                          src={match.teams.home.logo} 
                          alt={`${match.teams.home.name} logo`} 
                          className="team-logo"
                        />
                        <span>{match.teams.home.name}</span>
                      </div>
                      <div className="away-team">
                        <img 
                          src={match.teams.away.logo} 
                          alt={`${match.teams.away.name} logo`} 
                          className="team-logo"
                        />
                        <span>{match.teams.away.name}</span>
                      </div>
                    </div>
                    {selectedMatch && selectedMatch.id === match.id && (
                      <div className="events">
                        <h4>Eventos del Partido</h4>
                        {match.events && match.events.length > 0 ? (
                          <ul>
                            {match.events.map((event, eventIndex) => (
                              <li key={eventIndex}>
                                <strong>{event.type}</strong>: {event.player.name} ({event.minute} min)
                              </li>
                            ))}
                          </ul>
                        ) : (
                          <p>No hay eventos registrados.</p>
                        )}
                      </div>
                    )}
                  </div>
                </li>
              ))}
            </ul>
          ) : (
            <p>No hay partidos disponibles.</p>
          )}
        </div>
      )}
    </div>
  );
}

export default App;
